import React from 'react';
const Other = () => {
	return (
		<div className="shadow-radius">
			<div className="public-title" style={{border:'none'}}>
				<h1>其它控件见：<a target="_blank" href="https://ant.design/docs/react/introduce-cn" rel="noopener noreferrer">Antd-Design </a></h1>
			</div>
		</div>
	);
};

export default Other;
